import GithubLinkIcon from './github-link-icon'


const Header = () => {
  return (
    <>
      <header className="banner">
        <div>
          <GithubLinkIcon />
          
        </div>
      </header>
      <style jsx>
        {`
          .banner {
            color: hsla(0,0%,100%,.7);
            display: flex;
            padding: 16px;
            background-color: #24292e;
            justify-content: space-between;
          }
          svg{
            color:#fff;
          }
        `}
      </style>
    </>
    )
}


export default Header
